/*Table structure for table `processi` */

DROP TABLE IF EXISTS `processi`;

CREATE TABLE `processi` (
  `id_processo` int(11) NOT NULL AUTO_INCREMENT,
  `cod_processo` varchar(255) NOT NULL DEFAULT '',
  `des_processo` varchar(255) DEFAULT NULL,
  PRIMARY KEY (`id_processo`),
  KEY `id_processo` (`id_processo`)
) ENGINE=InnoDB AUTO_INCREMENT=8 DEFAULT CHARSET=utf8;

/*Data for the table `processi` */

