/*Table structure for table `processi_eventi` */

DROP TABLE IF EXISTS `processi_eventi`;

CREATE TABLE `processi_eventi` (
  `id_evento` int(11) NOT NULL AUTO_INCREMENT,
  `id_processo` int(11) NOT NULL DEFAULT '1',
  `cod_evento` varchar(20) NOT NULL,
  `des_evento` varchar(255) DEFAULT NULL,
  `stato_post` int(11) DEFAULT NULL,
  `id_tipo_mittente` varchar(4) DEFAULT NULL,
  `id_tipo_destinatario` varchar(4) DEFAULT NULL,
  `script_scadenza_evento` varchar(20) DEFAULT NULL,
  `verso` char(1) DEFAULT NULL,
  `flg_portale` varchar(1) NOT NULL DEFAULT 'N',
  `flg_mail` varchar(1) NOT NULL DEFAULT 'N',
  `flg_all_mail` varchar(1) NOT NULL DEFAULT 'N',
  `flg_protocollazione` varchar(1) DEFAULT NULL,
  `flg_ricevuta` varchar(1) NOT NULL DEFAULT 'N',
  `flg_destinatari` varchar(1) NOT NULL DEFAULT 'S',
  `flg_firmato` varchar(1) NOT NULL DEFAULT 'N',
  `flg_apri_sottopratica` varchar(1) DEFAULT NULL,
  `flg_destinatari_solo_enti` varchar(1) DEFAULT NULL,
  `flg_visualizza_procedimenti` varchar(1) DEFAULT NULL,
  `id_procedimento_riferimento` int(11) DEFAULT NULL,
  `id_script_evento` varchar(20) DEFAULT NULL,
  `id_script_protocollo` varchar(20) DEFAULT NULL,
  `max_destinatari` int(11) DEFAULT NULL COMMENT '0 illimitato',
  `oggetto_email` varchar(1024) DEFAULT NULL,
  `corpo_email` longtext,
  `funzione_applicativa` varchar(255) NOT NULL DEFAULT 'comunicazione',
  `flg_automatico` varchar(1) NOT NULL DEFAULT 'N',
  PRIMARY KEY (`id_evento`),
  KEY `processi_eventi_ana_tipi_mittente_id_tipo_mittente_fk` (`id_tipo_mittente`) USING BTREE,
  KEY `processi_eventi_lk_tipi_attore_cod_tipo_destinatario_fk` (`id_tipo_destinatario`),
  KEY `processi_eventi_lk_stato_pratica_fk` (`stato_post`),
  KEY `processi_eventi_procedimenti_fk1` (`id_procedimento_riferimento`),
  KEY `processi_eventi_processo_fk` (`id_processo`),
  CONSTRAINT `processi_eventi_lk_stato_pratica_fk` FOREIGN KEY (`stato_post`) REFERENCES `lk_stato_pratica` (`id_stato_pratica`),
  CONSTRAINT `processi_eventi_lk_tipi_attore_cod_tipo_destinatario_fk` FOREIGN KEY (`id_tipo_destinatario`) REFERENCES `lk_tipi_attore` (`id_tipo_attore`),
  CONSTRAINT `processi_eventi_lk_tipi_attore_cod_tipo_mittente_fk` FOREIGN KEY (`id_tipo_mittente`) REFERENCES `lk_tipi_attore` (`id_tipo_attore`),
  CONSTRAINT `processi_eventi_procedimenti_fk1` FOREIGN KEY (`id_procedimento_riferimento`) REFERENCES `procedimenti` (`id_proc`),
  CONSTRAINT `processi_eventi_processo_fk` FOREIGN KEY (`id_processo`) REFERENCES `processi` (`id_processo`) ON DELETE NO ACTION ON UPDATE NO ACTION
) ENGINE=InnoDB AUTO_INCREMENT=143 DEFAULT CHARSET=utf8 COMMENT='InnoDB free: 18432 kB; (`id_scadenza`) REFER `cross_devel/lk';

