/*Table structure for table `processi_eventi_scadenze` */

DROP TABLE IF EXISTS `processi_eventi_scadenze`;

CREATE TABLE `processi_eventi_scadenze` (
  `id_evento` int(11) NOT NULL,
  `id_ana_scadenza` varchar(4) NOT NULL,
  `id_stato_scadenza` varchar(4) NOT NULL COMMENT 'Se A apro la scadenza, se C chiudo la scadenza',
  `termini_scadenza` int(11) DEFAULT NULL,
  `script_scadenza` varchar(255) DEFAULT NULL,
  `flg_visualizza_scadenza` varchar(1) NOT NULL DEFAULT 'N',
  PRIMARY KEY (`id_evento`,`id_ana_scadenza`),
  KEY `processi_eventi_scadenze_stato_scadenze_fk1` (`id_stato_scadenza`),
  KEY `processi_eventi_scadenze_fk1` (`id_ana_scadenza`),
  CONSTRAINT `processi_eventi_evento_fk1` FOREIGN KEY (`id_evento`) REFERENCES `processi_eventi` (`id_evento`),
  CONSTRAINT `processi_eventi_scadenze_fk1` FOREIGN KEY (`id_ana_scadenza`) REFERENCES `lk_scadenze` (`id_ana_scadenze`),
  CONSTRAINT `processi_eventi_scadenze_stato_scadenze_fk1` FOREIGN KEY (`id_stato_scadenza`) REFERENCES `lk_stati_scadenze` (`id_stato`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

