/*Table structure for table `scadenze` */

DROP TABLE IF EXISTS `scadenze`;

CREATE TABLE `scadenze` (
  `id_scadenza` int(11) NOT NULL AUTO_INCREMENT,
  `id_pratica` int(11) NOT NULL,
  `data_scadenza` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  `id_ana_scadenza` varchar(4) NOT NULL,
  `data_fine_scadenza` date DEFAULT NULL,
  `id_stato` varchar(4) NOT NULL,
  `data_inizio_scadenza` date NOT NULL,
  `id_pratica_evento` int(11) NOT NULL COMMENT 'L''evento che ha creato la scadenza',
  `giorni_teorici_scadenza` int(11) NOT NULL DEFAULT '0',
  `descrizione_scadenza` varchar(255) DEFAULT NULL,
  PRIMARY KEY (`id_scadenza`),
  KEY `fk_scadenze` (`id_pratica`),
  KEY `fk_scadenze_1` (`id_ana_scadenza`),
  KEY `scadenze_lk_stati_scadenze_id_stato_fk` (`id_stato`),
  KEY `scadenze_pratica_evento` (`id_pratica_evento`),
  CONSTRAINT `fk_scadenze_1` FOREIGN KEY (`id_ana_scadenza`) REFERENCES `lk_scadenze` (`id_ana_scadenze`) ON DELETE NO ACTION ON UPDATE NO ACTION,
  CONSTRAINT `fk_scadenze_2` FOREIGN KEY (`id_pratica`) REFERENCES `pratica` (`id_pratica`),
  CONSTRAINT `scadenze_lk_stati_scadenze_id_stato_fk` FOREIGN KEY (`id_stato`) REFERENCES `lk_stati_scadenze` (`id_stato`),
  CONSTRAINT `scadenze_pratica_evento` FOREIGN KEY (`id_pratica_evento`) REFERENCES `pratiche_eventi` (`id_pratica_evento`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='InnoDB free: 15360 kB; (`cod_sport` `id_pratica`) REFER `cro';

/*Data for the table `scadenze` */

/*Table structure for table `staging` */

DROP TABLE IF EXISTS `staging`;

CREATE TABLE `staging` (
  `id_staging` int(11) NOT NULL AUTO_INCREMENT,
  `data_ricezione` date NOT NULL,
  `xml_ricevuto` longblob,
  `xml_pratica` longblob,
  `oggetto` varchar(4000) DEFAULT NULL,
  `tipo_messaggio` varchar(20) NOT NULL,
  `data_apertura` date DEFAULT NULL,
  `id_utente_apertura` int(11) DEFAULT NULL,
  `id_ente` int(11) NOT NULL,
  PRIMARY KEY (`id_staging`),
  KEY `staging_utente_fk1` (`id_utente_apertura`),
  KEY `staging_ente_fk1` (`id_ente`),
  CONSTRAINT `staging_ente_fk1` FOREIGN KEY (`id_ente`) REFERENCES `enti` (`id_ente`),
  CONSTRAINT `staging_utente_fk1` FOREIGN KEY (`id_utente_apertura`) REFERENCES `utente` (`id_utente`)
) ENGINE=InnoDB AUTO_INCREMENT=8 DEFAULT CHARSET=utf8;

